import React from 'react'
import { useMutation } from '@tanstack/react-query'
import { useFormik } from 'formik'

const PostPage = () => {
    const formik = useFormik({
        initialValues: {
            title: '',
            content: '',
            dateTime: new Date(),
            image: '',
            author: ''
        }
    })
  return (
    <div>
        <form>
            <input
                className = 'post-form-input'
                type = 'text'
                name = 'post'
            />
        </form>
    </div>
  )
}

export default PostPage
